import React from 'react'

function GridItem(props) {
    
    var count = props.count/10
    var countArray

    for(let i=0; i<count; i++){
        countArray.push(i)
    }
    
    console.log(countArray)

    return (
        <div className='item'></div>
  )
}

export default GridItem
